import styles from "../styles/Footer.module.css";
// import TP from "../images/pfp.png";

const Footer = () => {
  return (
    <div className={styles.all}>
      <p>Let's Connect</p>
      <img
        style={{
          //     width: "20%",
          //     height: "20%",
          marginLeft: 100,
          //     paddingRight: 5,
          //     paddingBottom: 30,
          //     display: "inline",
        }}
        src="../images/pfp.png"
      />
    </div>
  );
};

export { Footer };
